import MovieItem from "../components/MovieItem";
import CommentBox from "../components/ui/js/CommentBox";
import MoviePosterCard from "../components/ui/js/MoviePosterCard";
import classes from "./MoviePage.module.css"
import classest from "../components/ui/Card.module.css"

function MoviePage() {

    return (
        <div className={classes.flexboxcontainer}>
            <Card stylecard={classest.postercard}>
                <MovieItem />
            </Card>
            <Card stylecard={classest.postercard}>
                <CommentBox />
            </Card>
        </div>
    );
}


export default MoviePage
